}

struct ManipulationState {
  public bool engine_switch; // Is engine switch on? true: on, false: off.

  public float flap_target_degree; // The flap target degrees. e.g., 0.0f, 10.0f, ... , 30.0f

  public float elevator_input; // [-1.0f, 1.0f] neg: nose up, pos: nose down
  public float thrust_input; // [0.0f, 1.0f]
  public float roll_input; // [-1.0f, 1.0f] neg: left turn, pos: right turn

  public bool is_controlled_by_flights_manager; // Is the flight control by user joystick or flights_manager

  public float final_descend_control_update_timer; // used to time throttle for every 1 second to update once.
}

struct AircraftState {
  public ManipulationState manipulation_state; // the input interface variables and their states
  public AircraftStateOutput output; // the output state struct

  public bool is_connected_to_ui;

  public float dt; // delta time between fixed steps

  public bool is_grounded; // is aircraft on the ground or in the air
  public bool is_ground_radar_needed; // is taxi raycast scan needed;
  public bool ground_radar_direction; // true-front, false-rear

  public float heading; // heading, in degrees [0, 359]. North is 0 degree, east is 90, south is 180, west is 270.
  public float heading_change_rate; // heading change in degree/second
  public float altitude; // in ft
  public float vertical_rate; // state of the aircraft, m/s
  public float vertical_rate_display; // in ft/minute
  public float vertical_rate_display_target; // the vertical display rate(ft/min) the controller needs to follow
  public float vertical_rate_display_diff;

  // angle of attack
  public float angle_of_attack;

  // bank(roll) angle, indicates how fast the aircraft turns, this angle is in deg and is around z axis
  // right is +, left is -. Middle is 0.
  public float bank_angle;
  public float bank_angle_target;

  // pitch angle is different from angle_of_attack. AOA needs to consider the air velocity. pitch angle can be directly found from euler angles(around axis x).
  public float pitch_angle;

  // velocities
  public Vector3 body_ground_velocity;

  // Autopilot
  public AutopilotState autopilot_state;

  public float slide_angle; // velocity to the right is positive, left negative. Used signed angle, from tr.fwd to vel on xz plane, tr.up is the normal. left hand rotation.
  public float u; // pid control input to stablize the sliding angle
  public Vector3 local_yaw_torque; // 

  public float thrust_force; // coef_a * [(coef_b * rpm)^2 - (coef_b*rpm)*v0] * coef_c * exp(-1.256^10(-4) * height), pitch is how many inch prop forwards in one rotation. D in inch, V0 in m/s, height in m, rpm is rotations in a minute.

  // power input value from the control slider, this value will be used
  // as the new target value. And the power will be gradually increased to
  // the input target.
  public float propeller_rpm_target; // [0, propeller_rpm_max];
  public float propeller_rpm; // Propeller rpm state.

  // velocity   
  public Vector3 body_yz_velocity; // aircraft ground velocity projected on yz plane
  public Vector3 body_x_velocity; // aircraft ground velocity projected on x axis
  public Vector3 body_z_velocity; // aircraft ground velocity projected on z axis
  public Vector3 body_y_velocity; // aircraft ground velocity projected on y axis
  public Vector3 body_xz_velocity; // aircraft ground velocity projected on xz plane
  public Vector3 air_ground_velocity; // air velocity in world coordinate, this describes how air blows in the world
  public float speed; // for ui display, both on ground or in the air

  // body related
  public float body_drag_force_magnitude;
  public float body_lift_force_magnitude;
  public float body_lateral_force_magnitude;
  public Vector3 body_lateral_force;

  // air related
  public float air_density; // function of height
  public float coef_drag; // function of angle of attack

  // Tail wing related.
  public float elevator_angle; 
  public float tail_wing_trim_angle; // controlled by the trim
  public float tail_wing_angle_of_attack;
  public float tail_wing_lift_coef;
  public float tail_wing_drag_coef;
  public float left_tail_wing_drag_force_magnitude;
  public float right_tail_wing_drag_force_magnitude;
  public float left_tail_wing_lift_force_magnitude;
  public float right_tail_wing_lift_force_magnitude;
  public Vector3 left_tail_wing_force;
  public Vector3 right_tail_wing_force;
  public Vector3 left_tail_wing_center;
  public Vector3 right_tail_wing_center;
  public Vector3 left_tail_wing_drag_force;
  public Vector3 right_tail_wing_drag_force;

  // main wing related
  public float main_wing_angle_of_attack;
  public float main_wing_lift_coef;
  public float main_wing_drag_coef;
  public Vector3 left_wing_force;
  public Vector3 right_wing_force;
  public Vector3 left_wing_drag_force;
  public Vector3 right_wing_drag_force;
  public float left_wing_lift_force_magnitude;
  public float right_wing_lift_force_magnitude;
  public float left_wing_drag_force_magnitude;
  public float right_wing_drag_force_magnitude;
  public Vector3 left_wing_center;
  public Vector3 right_wing_center;
  public float main_wing_lift_arm;

  // Flap related
  public float flap_degree; // flap current degree
  public bool is_flap_degree_increasing; // determine whether the latest control command increase or decrease flap degree
  public int flap_degree_table_pointer; // the index to tell which flap value is the current setting in the flap_degree_table

  // aileron related
  public float aileron_impact_coef; // when aileron has an angle, this coef will be used to calculate the main wing lift force. This will eventually cause the aircraft to turn.
  public float aileron_degree; // left aileron position, in degree. Right aileron is the negative value of the left one.

  // lateral force center
  public Vector3 lateral_force_center; // transform.position + lateral_force_center_bias

  // rudder wing related
  public float rudder_wing_angle; // the rotation in local y axis
  public Vector3 rudder_wing_center;
  public Vector3 rudder_drag_force;
  public Vector3 rudder_rotation_force;

  // back wheel steering related
  public float back_wheel_steer_angle; // the rotation is in local y axis. If rotate clockwise, aircraft turns left.
}

