  private void DetermineBankAngleTarget(float dt) {
    if (Mathf.Abs(state.autopilot_state.auto_heading_diff) > 5.0f) {
      state.bank_angle_target = Mathf.Sign(state.autopilot_state.auto_heading_diff) * 10.0f;
    } else {
      state.bank_angle_target = 2.0f * state.autopilot_state.auto_heading_diff;
    }
  }

  private void ApplyAutoRollControl(float dt) {
    // Use PID to follow bank angle target
    // follow the bank angle target
    float kp = 0.4f;
    float ki = 0.2f;
    float kd = 0.00f;
    state.manipulation_state.roll_input = Mathf.Clamp(state.manipulation_state.roll_input +
                        (kp + ki * dt + kd / dt) * (state.bank_angle_target - state.bank_angle) +
                        (-kp - 2.0f * kd / dt) * (state_last.bank_angle_target - state_last.bank_angle) +
                        kd / dt * (state_last_last.bank_angle_target - state_last_last.bank_angle), -1.0f, 1.0f);

    /*
    // Use fuzzy logic to control the roll input
    float diff = state.autopilot_state.auto_heading_diff;
    float diff_dot = (state.autopilot_state.auto_heading_diff - state_last.autopilot_state.auto_heading_diff) / dt;
    Debug.Log("autoheadingdiff = " + diff);
    Debug.Log("autoheadingdiffdot = " + diff_dot);
    int diff_index = (int)(Math.Round(diff, 0) + 180);
    int diff_dot_index = Math.Clamp((int)(Math.Round(diff_dot, 0) + 30), 0, 60);
    Debug.Log("diff_index = " + diff_index);
    Debug.Log("diff_dot_index = " + diff_dot_index);
    state.manipulation_state.roll_input = AircraftProperty.roll_control_lookup_float[diff_index, diff_dot_index];
    */

    UpdateRollInput();

    // state.output.debug_data = "Heading: " + state.heading.ToString("F3") + " Target: " + state.autopilot_state.auto_heading_target + " Diff: " + state.autopilot_state.auto_heading_diff.ToString("F3")
    //                   + "\n" + "bank_target: " + state.bank_angle_target.ToString("F3") + " bank: " + state.bank_angle.ToString("F3")
    //                   + "\n" + "bank_diff: " + (state.bank_angle_target - state.bank_angle).ToString("F3")
    //                   + "\n" + "u: " + state.manipulation_state.roll_input.ToString("F3");
  }

  private void DetermineVerticalRateDisplayTarget() {
    // step 1: compute automatic vertical rate
    float vertical_rate_display_target_automation = 0.0f;
    state.autopilot_state.auto_altitude_diff = state.autopilot_state.auto_altitude_target - state.altitude;
    float auto_altitude_diff_abs = Mathf.Abs(state.autopilot_state.auto_altitude_diff);

    float[] altitude_diff_group = { 100.0f, 50.0f, 10.0f, 0.0f }; // last good value { 250.0f, 100.0f, 20.0f, 0.0f }
    float[] vertical_rate_display_target_group = { 700.0f, 350.0f, 175.0f, 10.0f }; // last good value { 700.0f, 350.0f, 175.0f, 10.0f }
    for (int i = 0; i < altitude_diff_group.Length; i++) {
      if (auto_altitude_diff_abs >= altitude_diff_group[i]) {
        vertical_rate_display_target_automation = Mathf.Sign(state.autopilot_state.auto_altitude_diff) * vertical_rate_display_target_group[i];
        break;
      }
    }

    // step 2: if auto vertical rate switch is on, determine which value(manual or automatic) to use
    if (state.autopilot_state.is_autopilot_on && state.autopilot_state.is_auto_vertical_rate_display_on && (auto_altitude_diff_abs >= altitude_diff_group[0])) {
      state.vertical_rate_display_target = state.autopilot_state.auto_vertical_rate_display_target;
    } else {
      state.vertical_rate_display_target = vertical_rate_display_target_automation;
      if (state.autopilot_state.is_auto_vertical_rate_display_on) {
        // auto_vertical_rate_display_target_box.text = "";
        SetAutoVerticalRateSwitch(false);
      }
    }
  }

  private void ApplyAutoPitchControl(float dt) {
    // step 1: set the vertical rate target based on flight phases
    // Done in fixed update.

    // step 2: use adaptive control to follow the vertical rate
    float pitch_change_rate = 0.0f; // 0.1 per second
    float throttle_change_rate = 0.0f; // 0.2 per second

    float[] vertical_rate_display_diff_group = { 150.0f, 50.0f, 25.0f, 10.0f, 0.0f };
    float[] pitch_change_rate_group = { 0.4f, 0.15f, 0.05f, 0.025f, 0.0125f }; // last good known { 0.4f, 0.15f, 0.05f, 0.025f, 0.0125f }
    float[] throttle_change_rate_group = { 0.2f, 0.1f, 0.05f, 0.025f, 0.0125f };
    for (int i = 0; i < vertical_rate_display_diff_group.Length; i++) {
      if (Mathf.Abs(state.vertical_rate_display_diff) > vertical_rate_display_diff_group[i]) {
        pitch_change_rate = pitch_change_rate_group[i];
        throttle_change_rate = throttle_change_rate_group[i];
        break;
      }
    }

    // Vertical rate following control logic
    // need to increase vertical_rate
    if (state.vertical_rate_display_diff > 0) {
      if (state_last.vertical_rate_display_diff < state.vertical_rate_display_diff) {
        state.manipulation_state.elevator_input -= (dt * pitch_change_rate);
        if (state_last_last.vertical_rate_display_diff < state_last.vertical_rate_display_diff) {
          // TODO: 0.04 here is too high? maybe need to set it lower
          ThrottleUp(0.02f * throttle_change_rate); // throttle up 0.01
        }
      }
    }
    // need to decrease vertical rate
    if (state.vertical_rate_display_diff < 0) {
      if (state_last.vertical_rate_display_diff > state.vertical_rate_display_diff) {
        state.manipulation_state.elevator_input += (dt * pitch_change_rate);
        if (state_last_last.vertical_rate_display_diff > state_last.vertical_rate_display_diff) {
          ThrottleDown(0.02f * throttle_change_rate); // throttle down 0.01
        }
      }
    }

    UpdatePitchInput();
    state.output.debug_data = "Vertical rate: " + state.vertical_rate_display.ToString("F0") + " target: " + state.vertical_rate_display_target.ToString("F0") +
                       "\n" + "Diff: " + state.vertical_rate_display_diff.ToString("F2") + " Diff_last: " + state_last.vertical_rate_display_diff.ToString("F2") + " Diff_last_last: " + state_last_last.vertical_rate_display_diff.ToString("F2") +
                       "\n" + " throttle: " + state.manipulation_state.thrust_input.ToString("F2") + " pitch: " + state.manipulation_state.elevator_input.ToString("F2");
  }

  // value controls on/off, direction controls front or rear(pushback), true-front, false-rear
  public void SetGroundRadar(bool value, bool direction) {
    state.is_ground_radar_needed = value;
    state.ground_radar_direction = direction;
    if (direction) {
      collide_info.raycast_range = 40.0f;
      collide_info.right_degree = 30;
      collide_info.left_degree = -30;
    } else {
      collide_info.raycast_range = 20.0f;
      collide_info.right_degree = 60;
      collide_info.left_degree = -60;
    }
  }

  public bool GetGroundRadar() {
    return state.is_ground_radar_needed;
  }

