    // Prepare the output state
    AircraftStateOutput output = new AircraftStateOutput();
    output.altitude = state.altitude;
    output.speed = state.speed;
    output.heading = state.heading;
    output.pitch_angle = state.pitch_angle;
    
    
    
    output.vertical_rate_display = state.vertical_rate_display;
    output.angle_of_attack = state.angle_of_attack;
