    output.left_wing_lift_force_magnitude = state.left_wing_lift_force_magnitude;
    output.slide_angle = state.slide_angle;
    output.u = state.u;
    output.local_yaw_torque_y = state.local_yaw_torque.y;
    output.tail_wing_trim_angle = state.tail_wing_trim_angle;
    output.engine_switch = state.manipulation_state.engine_switch;
    output.is_autopilot_on = state.autopilot_state.is_autopilot_on;
    output.is_auto_heading_on = state.autopilot_state.is_auto_heading_on;
    output.auto_heading_target = state.autopilot_state.auto_heading_target;
    output.is_auto_altitude_on = state.autopilot_state.is_auto_altitude_on;
    output.auto_altitude_target = state.autopilot_state.auto_altitude_target;
    output.is_auto_speed_on = state.autopilot_state.is_auto_speed_on;
    output.auto_speed_target = state.autopilot_state.auto_speed_target;
    output.is_auto_vertical_rate_display_on = state.autopilot_state.is_auto_vertical_rate_display_on;
    output.auto_vertical_rate_display_target = state.autopilot_state.auto_vertical_rate_display_target;
    output.thrust_input = state.manipulation_state.thrust_input;
    output.elevator_input = state.manipulation_state.elevator_input;
    output.roll_input = state.manipulation_state.roll_input;
    output.flap_degree_table_pointer = state.flap_degree_table_pointer;
    output.debug_data = state.output.debug_data;
    output.is_controlled_by_flights_manager = state.manipulation_state.is_controlled_by_flights_manager;

    return output;
  }

  // Start is called before the first frame update
  void Start() {
    engine_sound = GetComponent<AudioSource>();

    aircraft_body_rigidbody = aircraft_body.GetComponent<Rigidbody>();
    aircraft_body_rigidbody.centerOfMass = AircraftProperty.mass_center;

    // overwrite the inertia tensor
    aircraft_body_rigidbody.inertiaTensor = AircraftProperty.inertia_tensor;

    state.manipulation_state.flap_target_degree = 0.0f;
    state.flap_degree_table_pointer = 0;
    state.flap_degree = 0.0f;

    left_wheel_collider = left_wheel.GetComponent<WheelCollider>();
    right_wheel_collider = right_wheel.GetComponent<WheelCollider>();
    back_wheel_collider = back_wheel.GetComponent<WheelCollider>();
    left_wheel_collider.brakeTorque = 0.0f;
    right_wheel_collider.brakeTorque = 0.0f;

    for (int i = 0; i < AircraftProperty.lift0_coef_table_double.Length; i++) {
      AircraftProperty.lift0_coef_table_float[i] = (float)AircraftProperty.lift0_coef_table_double[i];
    }
    for (int i = 0; i < AircraftProperty.drag0_coef_table_double.Length; i++) {
      AircraftProperty.drag0_coef_table_float[i] = AircraftProperty.drag_compensation * (float)AircraftProperty.drag0_coef_table_double[i];
    }
    for (int i = 0; i < AircraftProperty.lift30_coef_table_double.Length; i++) {
      AircraftProperty.lift30_coef_table_float[i] = (float)AircraftProperty.lift30_coef_table_double[i];
    }
    for (int i = 0; i < AircraftProperty.drag30_coef_table_double.Length; i++) {
      AircraftProperty.drag30_coef_table_float[i] = AircraftProperty.drag_compensation * (float)AircraftProperty.drag30_coef_table_double[i];
    }

    // initialize taxiraycast direction
    collide_info.direction = 0;
    collide_info.raycast_range = 40.0f;
    collide_info.raycast_rotate_rate = 90.0f;
    collide_info.left_degree = -30;
    collide_info.right_degree = 30;
  }

  private void Update() {
    float dt_frame = Time.deltaTime;

    // Joystick Back Key, move aircraft a bit off the ground to resolve stuck problem
    if (Input.GetKey(KeyCode.JoystickButton6)) {
      transform.position = transform.position + new Vector3(0, 0.01f, 0);
    }

    // Rudder input
    if (state.is_grounded) {
      state.back_wheel_steer_angle = (Input.GetAxis("RudderLeft") - Input.GetAxis("RudderRight")) * AircraftProperty.back_wheel_steer_angle_max;
    } else {
      state.rudder_wing_angle = (Input.GetAxis("RudderLeft") - Input.GetAxis("RudderRight")) * AircraftProperty.rudder_wing_angle_max;
    }

    // raycast detection
    if (IsGrounded() && state.is_ground_radar_needed) {
      Vector3 radar_direction = state.ground_radar_direction? transform.forward : -transform.forward;
      radar_direction.y = 0;
      collide_info.direction += dt_frame * collide_info.raycast_rotate_rate;
      if (collide_info.direction > collide_info.right_degree) {
        collide_info.direction = collide_info.right_degree;
        collide_info.raycast_rotate_rate *= -1;
      }
      if (collide_info.direction < collide_info.left_degree) {
        collide_info.direction = collide_info.left_degree;
        collide_info.raycast_rotate_rate *= -1;
      }
      radar_direction = Quaternion.Euler(0, collide_info.direction, 0) * radar_direction;
      radar_direction.Normalize();
      float speed_coef = (GetSpeed() / 20) * 0.2f;
      radar_direction *= (collide_info.raycast_range * (1 + speed_coef));
      Debug.DrawRay(propeller.transform.position, radar_direction, Color.cyan);
      Physics.Raycast(propeller.transform.position, radar_direction, out collide_info.hit, collide_info.raycast_range);
      if (collide_info.hit.collider != null && collide_info.hit.collider.CompareTag("Aircraft")) {
        Debug.Log("Forward taxi collide detected!!");
        collide_info.callback(collide_info.direction, collide_info.hit);
      }
    }
  }

  // Update is called once per frame
  void FixedUpdate() {
    // 1.0
    state.dt = Time.fixedDeltaTime;

    // 2.0 Check grounded status
    state.is_grounded = left_wheel_collider.isGrounded || right_wheel_collider.isGrounded || back_wheel_collider.isGrounded;

    // 2.5 Update all speed
    state.body_ground_velocity = aircraft_body_rigidbody.velocity;
    state.body_yz_velocity = Vector3.ProjectOnPlane(state.body_ground_velocity, transform.right);
    state.body_x_velocity = state.body_ground_velocity - state.body_yz_velocity;
    state.body_z_velocity = Vector3.Project(state.body_yz_velocity, transform.forward);
    state.body_y_velocity = state.body_yz_velocity - state.body_z_velocity;
    state.body_xz_velocity = Vector3.ProjectOnPlane(state.body_ground_velocity, -transform.up);
    state.vertical_rate = state.body_ground_velocity.y;
    state.vertical_rate_display = state.vertical_rate * 3.28084f * 60.0f;
    state.speed = state.is_grounded ? aircraft_body_rigidbody.velocity.magnitude * AircraftProperty.m_per_second_to_knots :
                                               state.body_z_velocity.magnitude * AircraftProperty.m_per_second_to_knots;

    // 2.6 Update bank/roll angle
    float euler_z_angle = transform.eulerAngles.z;
    if (euler_z_angle <= 180.0f) {
      state.bank_angle = -euler_z_angle;
    } else {
      state.bank_angle = 360.0f - euler_z_angle;
    }

    // 2.7 Upate pitch angle
    float euler_x_angle = transform.eulerAngles.x;
    if (euler_x_angle <= 180.0f) {
      state.pitch_angle = -euler_x_angle;
    } else {
      state.pitch_angle = 360.0f - euler_x_angle;
    }

    // 2.8 Update heading
    state.heading = transform.eulerAngles.y;

    // 2.9 Update Altitude
    state.altitude = transform.position.y * 3.28084f;

    // 2.9.1 Update slide angle
    state.slide_angle = Vector3.SignedAngle(transform.forward, state.body_xz_velocity, transform.up);

    // 2.9.2 Angle of attack computation
    if (state.speed < 1) {
      state.angle_of_attack = 0;
    } else {
      state.angle_of_attack = Vector3.SignedAngle(transform.forward, state.body_yz_velocity, transform.right);
    }

    // 3.0 Propeller RPM calculation
    if (!state.manipulation_state.engine_switch) {
      state.propeller_rpm_target = state.body_z_velocity.magnitude / AircraftProperty.coef_b;
    }
    if (state.propeller_rpm != state.propeller_rpm_target) {
      if (state.propeller_rpm < state.propeller_rpm_target) {
        state.propeller_rpm += AircraftProperty.rpm_change_rate * state.dt;
        if (state.propeller_rpm > state.propeller_rpm_target) {
          state.propeller_rpm = state.propeller_rpm_target;
        }
      } else {
        state.propeller_rpm -= AircraftProperty.rpm_change_rate * state.dt;
        if (state.propeller_rpm < state.propeller_rpm_target) {
          state.propeller_rpm = state.propeller_rpm_target;
        }
      }
    }
    propeller.transform.Rotate(0, 0, state.dt * state.propeller_rpm * 13f); // 6.0f is 1/60 * 360 degrees. Use a bias let propeller look good.

    // Update engine sound
    if (state.manipulation_state.engine_switch) {
      engine_sound.pitch = AircraftProperty.engine_sound_low_pitch + (AircraftProperty.engine_sound_high_pitch - AircraftProperty.engine_sound_low_pitch) *
                           state.propeller_rpm / (AircraftProperty.propeller_rpm_max - AircraftProperty.propeller_rpm_min);
      engine_sound.volume = AircraftProperty.engine_sound_low_volume + (AircraftProperty.engine_sound_high_volume - AircraftProperty.engine_sound_low_volume) *
                            state.propeller_rpm / (AircraftProperty.propeller_rpm_max - AircraftProperty.propeller_rpm_min);
    }
    
    // 5.0 pitch control
    if (state.autopilot_state.is_autopilot_on && state.autopilot_state.is_auto_altitude_on) {
      DetermineVerticalRateDisplayTarget();
      state.vertical_rate_display_diff = state.vertical_rate_display_target - state.vertical_rate_display;
      ApplyAutoPitchControl(state.dt);
    }
    state.lateral_force_center = transform.position + AircraftProperty.lateral_force_center_bias;

    // When the aircraft is turning right, the rate is +, when turning left, the rate is -.
    state.heading_change_rate = CalculateHeadingDiff(state_last.heading, state.heading) / state.dt;
    if (state.autopilot_state.is_autopilot_on && state.autopilot_state.is_auto_heading_on) {
      // If need to turn right, the diff is +, if need to turn left, the diff is -.
      state.autopilot_state.auto_heading_diff = CalculateHeadingDiff(state.heading, state.autopilot_state.auto_heading_target);
      DetermineBankAngleTarget(state.dt);
      ApplyAutoRollControl(state.dt);
    }

    // Propeller force calculation
    float rho, tp, pr;
    // for h < 11000, Tp = 15.04 - 0.00649 * h, p = 101.29 * ((Tp + 273.1) / 288.08)^5.256
    // for h < 25000, Tp = -56.46, p = 22.65 * exp(1.73 - 0.000157h)
    // for h > 25000, Tp = -131.21 + 0.00299 * h, p = 2.488 * ((Tp + 273.1) / 216.6))^-11.388
    if (transform.position.y <= 11000.0f) {
      tp = 15.04f - 0.00649f * transform.position.y;
      pr = 101.29f * Mathf.Pow((tp + 273.1f) / 288.08f, 5.256f);
    } else if (transform.position.y <= 25000.0f) {
      tp = -56.46f;
      pr = 22.65f * Mathf.Exp(1.73f - 0.000157f * transform.position.y);
    } else {
      tp = -131.21f + 0.00299f * transform.position.y;
      pr = 2.488f * Mathf.Pow((tp + 273.1f) / 216.6f, -11.388f);
    }
    rho = pr / (0.2869f * (tp + 273.1f));
    if (state.propeller_rpm != 0) {
      state.thrust_force = (AircraftProperty.k_prop * state.body_z_velocity.magnitude / (state.propeller_rpm / 60.0f * AircraftProperty.propeller_diameter / 100.0f) + AircraftProperty.b_prop)
                   * rho * Mathf.Pow((state.propeller_rpm / 60.0f), 2.0f) * Mathf.Pow(AircraftProperty.propeller_diameter / 100.0f, 4.0f);
      // Debug.Log(state.propeller_rpm);
      aircraft_body_rigidbody.AddForceAtPosition(Quaternion.AngleAxis(AircraftProperty.propeller_down_angle, transform.right) * transform.forward * state.thrust_force, aircraft_body_rigidbody.worldCenterOfMass + transform.forward * AircraftProperty.propeller_z_bias, ForceMode.Force);
    }

    // Calculate body force, 1) drag due to yz_velocity and 2) lateral due to x_velocity
    state.air_density = Mathf.Pow((1.0f - transform.position.y / 0.3048f / 145454.0f), 4.2493f) * 1.225f;
    state.body_drag_force_magnitude = state.air_density / 2.0f * Mathf.Pow(state.body_z_velocity.magnitude, 2.0f) * AircraftProperty.coef_drag * AircraftProperty.body_area.z;
    aircraft_body_rigidbody.AddForceAtPosition(-state.body_z_velocity.normalized * state.body_drag_force_magnitude, aircraft_body_rigidbody.worldCenterOfMass - 0.4f * transform.up, ForceMode.Force);
    state.body_lift_force_magnitude = state.air_density / 2.0f * Mathf.Pow(state.body_y_velocity.magnitude, 2.0f) * AircraftProperty.coef_drag * AircraftProperty.body_area.y;
    aircraft_body_rigidbody.AddForceAtPosition(-state.body_y_velocity.normalized * state.body_lift_force_magnitude, aircraft_body_rigidbody.worldCenterOfMass + 0.2f * transform.forward, ForceMode.Force);

    float lateral_coef_drag = 0.6f;
    state.body_lateral_force_magnitude = state.air_density / 2.0f * Mathf.Pow(state.body_x_velocity.magnitude, 2.0f) * lateral_coef_drag * AircraftProperty.body_area.x;

    state.body_lateral_force = -state.body_x_velocity.normalized * state.body_lateral_force_magnitude;
    // aircraft_body_rigidbody.AddForceAtPosition(body_lateral_force, lateral_force_center, ForceMode.Force);


    // Calculate flap degrees and update lift coef and drag coef
    if (state.flap_degree != state.manipulation_state.flap_target_degree) {
      float flap_degree_diff_abs = Mathf.Abs(state.manipulation_state.flap_target_degree - state.flap_degree);
      float flap_degree_change = AircraftProperty.flap_change_rate * state.dt;
      if (flap_degree_diff_abs <= flap_degree_change) {
        state.flap_degree = state.manipulation_state.flap_target_degree;
      } else {
        state.flap_degree += Mathf.Sign(state.manipulation_state.flap_target_degree - state.flap_degree) * flap_degree_change;
      }
    }
    float coef_due_to_flap = state.flap_degree / (AircraftProperty.flap_30_degree - AircraftProperty.flap_0_degree);
    flap_left.transform.localRotation = Quaternion.Euler(-state.flap_degree, 0, -3.497f);
    flap_right.transform.localRotation = Quaternion.Euler(-state.flap_degree, 0, 3.497f);

    // Calculate aileron impacting coef on the wing lift and drag
    // update roll input is already called.


    // Calculate main wing lift
    state.main_wing_angle_of_attack = state.angle_of_attack + AircraftProperty.main_wing_mounting_angle;
    // Debug.Log(state.main_wing_angle_of_attack);
    int coef_lookup_index = Mathf.FloorToInt(state.main_wing_angle_of_attack * 10.0f) + 1800;
    state.main_wing_lift_coef = AircraftProperty.lift0_coef_table_float[coef_lookup_index] +
                            (AircraftProperty.lift30_coef_table_float[coef_lookup_index] - AircraftProperty.lift0_coef_table_float[coef_lookup_index]) * coef_due_to_flap;
    state.left_wing_lift_force_magnitude = state.air_density / 2.0f * Mathf.Pow(state.body_ground_velocity.magnitude, 2.0f) *
                                     state.main_wing_lift_coef * AircraftProperty.main_wing_area;
    state.right_wing_lift_force_magnitude = state.air_density / 2.0f * Mathf.Pow(state.body_ground_velocity.magnitude, 2.0f) *
                                      state.main_wing_lift_coef * AircraftProperty.main_wing_area;
    state.left_wing_center = transform.position - 3.15f * transform.right + 1.15f * transform.forward - transform.up * 0.3f;
    state.right_wing_center = transform.position + 3.15f * transform.right + 1.15f * transform.forward - transform.up * 0.3f;

    state.left_wing_force = Quaternion.AngleAxis(-AircraftProperty.main_wing_roll_angle, transform.forward) * transform.up *
                      state.left_wing_lift_force_magnitude * (1.0f + state.aileron_impact_coef);
    state.right_wing_force = Quaternion.AngleAxis(AircraftProperty.main_wing_roll_angle, transform.forward) * transform.up *
                       state.right_wing_lift_force_magnitude * (1.0f - state.aileron_impact_coef);
    aircraft_body_rigidbody.AddForceAtPosition(state.left_wing_force, state.left_wing_center, ForceMode.Force);
    aircraft_body_rigidbody.AddForceAtPosition(state.right_wing_force, state.right_wing_center, ForceMode.Force);

    // Calculate main wing drag
    state.main_wing_drag_coef = AircraftProperty.drag0_coef_table_float[coef_lookup_index] +
                          (AircraftProperty.drag30_coef_table_float[coef_lookup_index] - AircraftProperty.drag0_coef_table_float[coef_lookup_index]) * coef_due_to_flap;
    state.left_wing_drag_force_magnitude = state.air_density / 2.0f * Mathf.Pow(state.body_ground_velocity.magnitude, 2.0f) *
                                     state.main_wing_drag_coef * AircraftProperty.main_wing_area;
    state.right_wing_drag_force_magnitude = state.air_density / 2.0f * Mathf.Pow(state.body_ground_velocity.magnitude, 2.0f) *
                                      state.main_wing_drag_coef * AircraftProperty.main_wing_area;
    state.left_wing_drag_force = -transform.forward * state.left_wing_drag_force_magnitude * (1.0f + state.aileron_impact_coef);
    state.right_wing_drag_force = -transform.forward * state.right_wing_drag_force_magnitude * (1.0f - state.aileron_impact_coef);
    aircraft_body_rigidbody.AddForceAtPosition(state.left_wing_drag_force, state.left_wing_center, ForceMode.Force);
    aircraft_body_rigidbody.AddForceAtPosition(state.right_wing_drag_force, state.right_wing_center, ForceMode.Force);

    // Calculate tail wing down force
    state.tail_wing_angle_of_attack = state.angle_of_attack + AircraftProperty.tail_wing_initial_shooting_angle + state.elevator_angle + state.tail_wing_trim_angle;
    int tail_static_coef_lookup_index = Mathf.FloorToInt(state.tail_wing_angle_of_attack * 10.0f) + 1800;
    state.tail_wing_lift_coef = AircraftProperty.lift0_coef_table_float[tail_static_coef_lookup_index];
    state.left_tail_wing_center = transform.position - 0.875f * transform.right - 2.9f * transform.forward + transform.up * 0.1f;
    state.right_tail_wing_center = transform.position + 0.875f * transform.right - 2.9f * transform.forward + transform.up * 0.1f;
    state.left_tail_wing_lift_force_magnitude = state.air_density / 2.0f * Mathf.Pow(state.body_ground_velocity.magnitude, 2.0f) *
                                          state.tail_wing_lift_coef * AircraftProperty.tail_wing_static_area;
    state.right_tail_wing_lift_force_magnitude = state.air_density / 2.0f * Mathf.Pow(state.body_ground_velocity.magnitude, 2.0f) *
                                           state.tail_wing_lift_coef * AircraftProperty.tail_wing_static_area;
    state.left_tail_wing_force = transform.up * state.left_tail_wing_lift_force_magnitude;
    state.right_tail_wing_force = transform.up * state.right_tail_wing_lift_force_magnitude;
    aircraft_body_rigidbody.AddForceAtPosition(state.left_tail_wing_force, state.left_tail_wing_center, ForceMode.Force);
    aircraft_body_rigidbody.AddForceAtPosition(state.right_tail_wing_force, state.right_tail_wing_center, ForceMode.Force);

    // Calculate tail wing drag
    state.tail_wing_drag_coef = AircraftProperty.drag0_coef_table_float[tail_static_coef_lookup_index];
    state.left_tail_wing_drag_force_magnitude = state.air_density / 2.0f * Mathf.Pow(state.body_ground_velocity.magnitude, 2.0f) *
                                          state.tail_wing_drag_coef * AircraftProperty.tail_wing_static_area;
    state.right_tail_wing_drag_force_magnitude = state.air_density / 2.0f * Mathf.Pow(state.body_ground_velocity.magnitude, 2.0f) *
                                           state.tail_wing_drag_coef * AircraftProperty.tail_wing_static_area;
    state.left_tail_wing_drag_force = -transform.forward * state.left_tail_wing_drag_force_magnitude;
    state.right_tail_wing_drag_force = -transform.forward * state.right_tail_wing_drag_force_magnitude;
    aircraft_body_rigidbody.AddForceAtPosition(state.left_tail_wing_drag_force, state.left_tail_wing_center, ForceMode.Force);
    aircraft_body_rigidbody.AddForceAtPosition(state.right_tail_wing_drag_force, state.right_tail_wing_center, ForceMode.Force);

    // Calculate rudder wing force, this cause yaw stability
    flap_rudder.transform.localRotation = Quaternion.Euler(0, state.rudder_wing_angle, 0);
    float kp = 250.0f;
    float ki = 0.0f;
    float kd = 100.0f;

    // PID controller to stabilize the slide angle
    state.u = state_last.u + (kp + ki * state.dt + kd / state.dt) * state.slide_angle + (-kp - 2.0f * kd / state.dt) * state_last.slide_angle + kd / state.dt * state_last_last.slide_angle;
    state.local_yaw_torque.y = state.u;

    if (!state.is_grounded && state.body_ground_velocity.magnitude >= 15) {
      aircraft_body_rigidbody.AddRelativeTorque(state.local_yaw_torque);
    }
    if (state.is_grounded) {
      back_wheel_collider.steerAngle = state.back_wheel_steer_angle * 0.6f;
    }


    // Roll stablizer
    if (transform.right.y != 0) {
      Vector3 local_roll_torque = new Vector3(0, 0, -transform.right.y * 0.0f);
      // aircraft_body_rigidbody.AddRelativeTorque(local_roll_torque);
    }

    float ray_coef = 0.1f;
    Debug.DrawRay(transform.position + transform.forward * 10.0f, state.body_yz_velocity, Color.cyan, 0);
    Debug.DrawRay(transform.position + transform.forward * 10.0f, state.body_xz_velocity, Color.red, 0);
    Debug.DrawRay(transform.position + transform.forward * 10.0f, state.body_ground_velocity, Color.yellow, 0);
    Debug.DrawRay(transform.position + transform.forward * 10.0f, transform.forward * state.thrust_force, Color.blue, 0);
    Debug.DrawRay(transform.position + transform.forward * 10.0f, state.body_x_velocity, Color.green, 0);

    // body drag, yellow
    // Debug.DrawRay(aircraft_body_rigidbody.worldCenterOfMass, -transform.forward * body_drag_force_magnitude, Color.yellow, 0);
    Debug.DrawRay(state.lateral_force_center, state.body_lateral_force, Color.cyan, 0);
    // left and right wing lift force, green
    // Debug.DrawRay(left_wing_center, left_wing_force * ray_coef, Color.green, 0);
    // Debug.DrawRay(right_wing_center, right_wing_force * ray_coef, Color.green, 0);
    // left and right wing drag force, yellow
    // Debug.DrawRay(left_wing_center, left_wing_drag_force * ray_coef, Color.yellow, 0);
    // Debug.DrawRay(right_wing_center, right_wing_drag_force * ray_coef, Color.yellow, 0);

    // rudder_wing_force
    Debug.DrawRay(state.rudder_wing_center, state.rudder_drag_force, Color.blue, 0);
    Debug.DrawRay(state.rudder_wing_center, state.rudder_rotation_force, Color.blue, 0);

    // left and right tail wing down force, red
    // Debug.DrawRay(left_tail_wing_center, left_tail_wing_force * ray_coef, Color.red, 0);
    // Debug.DrawRay(right_tail_wing_center, right_tail_wing_force * ray_coef, Color.red, 0);
    // left and right tail wing drag force, yellow
    // Debug.DrawRay(left_tail_wing_center, left_tail_wing_drag_force * ray_coef, Color.yellow, 0);
    // Debug.DrawRay(right_tail_wing_center, right_tail_wing_drag_force * ray_coef, Color.yellow, 0);

    // Center of mass, red
    Debug.DrawRay(aircraft_body_rigidbody.worldCenterOfMass, transform.up * 100.0f, Color.red, 0);

    if (state.manipulation_state.thrust_input != state_last.manipulation_state.thrust_input) {
      if (state.is_connected_to_ui) {
        ui_manager.GetComponent<UiManager>().SetThrottleSlider(state.manipulation_state.thrust_input);
      }
    }

    // Update state t-1 and state t-2.
    state_last_last = state_last;
    state_last = state;
  }
}